import React from 'react';
import {BrowserRouter} from 'react-router-dom';
import Navbar from '..Components/Layout/Navbar';
import './App.css';

function App() {
  return (
    <BrowserRouter>
    <div className="App">
      <h1>Reddit App!</h1>
    </div>
    </BrowserRouter>
  );
}

export default App;
